        "news": "&lt;span style=&quot;color: rgb(38, 38, 38); font-family: -apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;Watang Sawitto -- Dalam rangka evaluasi dan perencanaan pembangunan, Pemerintah Kabupaten Pinrang dalam hal ini Bappelitbangda Kabupaten Pinrang pada hari ini (24/3) melaksanakan Musyawarah Perencanaan Pembangunan (Musrenbang) Rencana Kerja Pemerintah Daerah (RKPD) Kabupaten Pinrang tahun 2023. Kegiatan ini bertempat di Ruang Pola Kantor Bupati Pinrang. Kegiatan tahunan ini dihadiri oleh asisten 1 bagian pemerintah Provinsi Sulawesi Selatan, wakil bupati Kabupaten Pinrang, dan seluruh kepala/ketua OPD serta delegasi tiap kecamatan se-Kabupaten Pinrang. Turut hadir pula beberapa LSM di Kabupaten Pinrang pada Musrenbang hari ini.&lt;/span&gt;&lt;br style=&quot;color: rgb(38, 38, 38); font-family: -apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br style=&quot;color: rgb(38, 38, 38); font-family: -apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;color: rgb(38, 38, 38); font-family: -apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;H. Muhammad Asri Lantong, SE, selaku Kepala BPS Kabupaten Pinrang turut hadir pula pada acara Musrenbang hari ini, untuk memaparkan kajian mengenai &#039;Analisis Indikator Sosial Ekonomi Kabupaten Pinrang Tahun 2021&#039;. H. Asri menyampaikkan indikator makro strategis Kabupaten Pinrang tahun 2021 seperti kependudukan, pendidikan, perekonomian, Indeks Pembangunan Manusia (IPM), kemiskinan dan ketenagakerjaan di Kabupaten Pinrang.&lt;